class DcbxPriorityTCMap(TextualConvention, OctetString):
    description = 'Each group of four octets in this string specify a 32-bit Traffic class ID. The IDs are stored in network byte order; i.e. octet N corresponds to the most significant 8 bits of the ID, and octet N+3 correspond to the least significant 8 bits. The list is large enough to hold 8 TC IDs, one per priority. The first first 4 octets represent the first priority.'
    status = 'current'
    subtypeSpec = OctetString.subtypeSpec + ValueSizeConstraint(32, 32)
    fixedLength = 32

