class DcbxTCsPresent(TextualConvention, OctetString):
    description = 'Octet representing the traffic classes present in a particular profile. Each bit represents the presence of the traffic class. The first bit indicates if TC 0 is present, the second bit indicates TC 1, and so forth. Bit value 1 indicates the TC is present. Bit value 0 indicates the TC is not present. Can be used to change the TC numbering.'
